import './projects.css';
import WebHeader from '../../components/header.js';

function projects() {
	return (
		<div className="projects-body">
			<header className='header'>
			<div><WebHeader title={"Projects"} quote={"Success is to be measured not so much by the position that one has reached in life as by the obstacles which he has overcome"}/></div>
			</header>

		</div>
	);
}

export default projects;
